INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLYM', 'STOCK', 'Climb Bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Climb Bio, Inc. is a clinical-stage biotechnology company. The Company is focused on developing therapeutics for patients with immune-mediated diseases. The CompanyÂ’s lead product candidate, budoprutug, is an anti-CD19 monoclonal antibody designed to deplete CD19-positive B cells, including antibody-secreting cells, in order to directly reduce pathogenic autoantibodies. The reduction of autoantibodies has the potential to be disease-modifying in autoantibody-driven diseases, such as systemic lupus erythematosus, immune thrombocytopenia, and membranous nephropathy. The budoprutug is in a Phase Ib/IIa clinical trial. The Company is also developing CLYM116, an anti-APRIL antibody, in investigational new drug applications (IND)-enabling studies for IgA nephropathy (IgAN).', 'Wellesley Hills, MA, United States', 17);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVA', 'STOCK', 'Avista Corporation', 'NYQ', 'Utilities', 'Utilities - Diversified', 'Avista Corp. is an energy company involved in the production, transmission and distribution of energy as well as other energy-related businesses. Its segment includes Avista Utilities and AEL&P. The Avista Utilities segment comprises regulated utility operations in Washington, Idaho, Oregon and Montana. It engages in electric distribution and transmission, and natural gas distribution services in parts of eastern Washington and northern Idaho. It also provides natural gas distribution service in parts of northeastern and southwestern Oregon. Additionally, it supplies electricity to a small number of customers in Montana. Avista Utilities also engages in wholesale purchases and sales of electricity and natural gas as an integral part of energy resource management and its load-serving obligation. The AEL&P segment is a regulated utility providing electric services in Juneau, Alaska that is a wholly owned subsidiary and the primary operating subsidiary of AERC.', 'Spokane, WA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMTG', 'STOCK', 'Claros Mortgage Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Claros Mortgage Trust, Inc. is a real estate investment trust. The Company is focused primarily on originating senior and subordinate loans on transitional commercial real estate (CRE) assets located in markets across the United Sates. Its objective is to provide debt capital for transitional CRE assets and, in doing so, to generate risk-adjusted returns for its stockholders. It seeks primarily to originate, co-originate and acquire senior and subordinate loans on transitional CRE assets located in the United States markets and generally intend to hold its loans to maturity. In addition to its primary focus on the United States markets, it also seeks to originate senior and subordinate loans on transitional CRE assets located in other markets. It also focuses on mortgage loans secured by a first priority or subordinate mortgage on transitional CRE assets, and subordinate loans, including mezzanine loans. The Company is externally managed and advised by Claros REIT Management LP.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGIO', 'STOCK', 'Agios Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Agios Pharmaceuticals, Inc. is a biopharmaceutical company. The Company is focused on developing and delivering transformative therapies for patients living with rare diseases. It markets a first-in-class pyruvate kinase (PK) activator for adults with PK deficiency, the first disease-modifying therapy for debilitating hemolytic anemia. Its lead product candidate in its portfolio, PYRUKYND (mitapivat), is an activator of both wild-type and mutant pyruvate kinase, or PK, enzymes for the potential treatment of hemolytic anemias. It is also developing tebapivat, a novel PK activator, for the potential treatment of lower-risk myelodysplastic syndromes, or LR MDS, and hemolytic anemias; AG-181, its phenylalanine hydroxylase, or PAH, stabilizer for the potential treatment of phenylketonuria, or PKU; and AG-236, an siRNA in-licensed from Alnylam Pharmaceuticals, Inc., targeting the transmembrane serine protease 6, or TMPRSS6 gene for the potential treatment of polycythemia vera, or PV.', 'Cambridge, MA, United States', 486);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBI', 'STOCK', 'Designer Brands Inc.', 'NYQ', 'Consumer Cyclical', 'Footwear & Accessories', 'Designer Brands Inc. is a designer, producer and retailer of footwear brands and accessories. The Company operates through three segments: the U.S. Retail segment, the Canada Retail segment, and the Brand Portfolio segment. The U.S. Retail segment operates the DSW Designer Shoe Warehouse (DSW) banner through its direct-to-consumer United States stores and e-commerce site. The Canada Retail segment operates The Shoe Company, DSW, and Rubino banners through its direct-to-consumer stores and e-commerce sites in Canada. The Brand Portfolio segment is engaged in the wholesale of its branded products to retailers and international distributors; commissions for serving retailers as the design and buying agent for products under private labels; and the sale of its Vince Camuto, Keds, and Topo brands through direct-to-consumer e-commerce sites. The Company operates approximately 494 stores in the United States and 175 stores in Canada.', 'Columbus, OH, United States', 14000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APPF', 'STOCK', 'AppFolio, Inc.', 'NGM', 'Technology', 'Software - Application', 'AppFolio, Inc. is a technology company focusing on the real estate industry. It provides a cloud-based platform on which its customers operate their businesses. It also provides key functionality related to critical transactions across the real estate lifecycle, including screening potential residents, sending and receiving payments, and providing insurance-related risk mitigation services. Its platform is AppFolio Realm, a suite of AI-powered tools that assist with leasing, maintenance, accounting, and other business-critical tasks. AppFolio Realm includes generative AI to answer questions, perform tasks and automate common workflows. The platform also includes Stack, its partner ecosystem that allows customers to connect its platform with specialized technology and services offered by third parties. Its platform is offered as a service and made available via three subscription plans: AppFolio Property Manager Core, AppFolio Property Manager Plus, and AppFolio Property Manager Max.', 'Santa Barbara, CA, United States', 1634);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUO', 'STOCK', 'Fangdd Network Group Ltd.', 'NCM', 'Real Estate', 'Real Estate Services', 'Fangdd Network Group Ltd is a company that mainly engaged in providing solutions for real estate brokers through online real estate trading platform SaaS. SaaS-based solutions connect real estate agents with essential business resources, including customers, property listings, capital and transaction data. The platform matches agents with the listings as well as buyers, sellers, landlords, renters. The Company operates its businesses primarily in the China market.', 'Shenzhen, , China', 134);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASGN', 'STOCK', 'ASGN Incorporated', 'NYQ', 'Technology', 'Information Technology Services', 'ASGN Incorporated is a provider of information technology (IT) services and solutions to the commercial and government sectors. The Company operates through two segments: Commercial and Federal Government. The Commercial segment provides a spectrum of IT services and solutions to Fortune 1000 and large mid-market clients. Growth in this segment is being driven by digital transformation and innovation requirements, including that of AI, workforce mobilization, and modern enterprise needs across five industry verticals: Financial Services, Consumer and Industrial, Technology, Media, and Telecom, Healthcare, and Business and Government Services. The Federal Government segment delivers advanced solutions in cloud and enterprise IT, cybersecurity, AI/ML, application, and digital transformation to agencies in both the public and private sectors. The segment provides services under time-and-materials, cost-reimbursable, and firm-fixed-price contracts.', 'Glen Allen, VA, United States', 3200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAE', 'STOCK', 'CAE Inc.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'CAE Inc. is a technology company. It operates in two segments: Civil Aviation and Defense and Security. The Civil Aviation training segment provides comprehensive training solutions for flight, cabin, maintenance and ground personnel in commercial, business and helicopter aviation, a complete range of flight simulation training devices, ab initio pilot training and crew sourcing services, as well as aircraft flight operations solutions. It manages approximately 324 full-flight simulators. Its training systems includes CAE Real-time Insights and Standardized Evaluations (CAE Rise), which improves training through the integration of untapped flight and simulator data-driven insights into training. The Defense and Security segment provides platform-independent training and simulation solutions, preparing global defense and security forces for the mission ahead. In addition to solutions delivered to customer sites, it provides comprehensive training at its CAE global training centers.', 'Saint-Laurent, QC, Canada', 13000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHF', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The CompanyÂ’s segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXSM', 'STOCK', 'Axsome Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Axsome Therapeutics, Inc. is a biopharmaceutical company. The Company is focused on the development and commercialization of medicines for people living with central nervous system (CNS) conditions. The Company''s commercial products include Auvelity, Sunosi and Symbravo. It is also advancing a diversified, late-stage pipeline of product candidates for serious neurological and psychiatric conditions, which include AXS-05, Solriamfetol, AXS-12 and AXS-14. Auvelity (dextromethorphan-bupropion) is an oral, N-methyl-D-aspartate (NMDA) receptor antagonist with multimodal activity indicated for the treatment of major depressive disorder (MDD). Sunosi (solriamfetol) is an oral medication indicated for the treatment of excessive daytime sleepiness (EDS), in patients with narcolepsy or obstructive sleep apnea. Symbravo (meloxicam and rizatriptan, 20 mg/10mg tablets) is an oral, single-dose medicine approved for the acute treatment of migraine with or without aura in adults.', 'New York, NY, United States', 846);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCI', 'STOCK', 'Donaldson Company, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Donaldson Company, Inc. specializes in technology-led filtration products and solutions, serving a range of industries and advanced markets. The Company''s segments include Mobile Solutions, Industrial Solutions and Life Sciences. Mobile Solutions segment is organized based on a combination of customers and products and consists of the off-road, on-road and aftermarket business units. Its products consist of replacement filters for both air and liquid filtration applications and filtration housings for new equipment production and systems related to exhaust and emissions. Industrial Solutions segment is organized based on product type and consists of industrial air filtration, industrial gasses, industrial hydraulics, power generation and aerospace and defense products. Life Sciences segment is organized by end market and consists of the bioprocessing equipment and consumables, food and beverage, vehicle electrification and medical device, microelectronics and disk drive markets.', 'Bloomington, MN, United States', 14000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUBI', 'STOCK', 'Customers Bancorp, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Customers Bancorp, Inc. is a bank holding company engaged in banking activities through its wholly owned subsidiary, Customers Bank (the Bank). The Bank provides banking products, primarily loans and deposits, to businesses and consumers through its branches, limited production offices and administrative offices in Berks County and Southeastern Pennsylvania, New York, Hamilton, New Jersey, Massachusetts, and other locations. It also administratively supports loans and other financial products, including equipment finance leases, to customers. It also serves specialized businesses nationwide, including its mortgage finance loans, commercial equipment financing, SBA lending, specialized lending and consumer loans through relationships with fintech companies. It also offers digital banking to commercial and consumer businesses nationwide. Its specialized lending includes fund finance, real estate specialty finance, technology and venture, healthcare and financial institutions groups.', 'West Reading, PA, United States', 809);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZH', 'STOCK', 'Beazer Homes USA, Inc.', 'NYQ', 'Consumer Cyclical', 'Residential Construction', 'Beazer Homes USA, Inc. is a geographically diversified homebuilder with active operations in approximately 13 states. It operates in three segments: West, East, and Southeast. The West segment includes Arizona, California, Nevada, and Texas. The East segment includes Delaware, Indiana, Maryland, New Jersey(a), Tennessee, and Virginia. The Southeast segment includes Florida, Georgia, North Carolina, and South Carolina. Its portfolio includes Montana Vista, Retreat at Rancho Mirage, Acacia Foothills at Estrella, Highpointe at Northpointe, Marbella at Windrose, Tirreno at IronWing, Cassia at Vistancia, Bethany Grove, Sanctuary, and Willows at Bella Vista Farms. It builds its homes in Arizona, California, Delaware, Florida, Georgia, Indiana, Maryland, Nevada, North Carolina, South Carolina, Tennessee, Texas, and Virginia. The Company with its Choice Plans, consumers can personalize primary living areas, giving you a choice of how you want to live in the home, at no additional cost.', 'Atlanta, GA, United States', 1158);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXON', 'STOCK', 'Axon Enterprise, Inc.', 'NMS', 'Industrials', 'Aerospace & Defense', 'A Axon Enterprise, Inc. Ã‰ fornecedora de soluÃ§Ãµes de tecnologia de aplicaÃ§Ã£o da lei. A empresa estÃ¡ envolvida na construÃ§Ã£o do sistema operacional de seguranÃ§a pÃºblica, integrando dispositivos de hardware e soluÃ§Ãµes de software em nuvem que lideram o policiamento, defesa e seguranÃ§a modernos. Seu ecossistema inclui dispositivos de energia TASER, cÃ¢meras usadas no corpo, cÃ¢meras no carro, soluÃ§Ãµes de gerenciamento de evidÃªncias digitais hospedadas na nuvem, software de produtividade, recursos de operaÃ§Ãµes em tempo real e integraÃ§Ãµes de terceiros por meio de sua rede de parceiros. O segmento TASER da Companhia oferece fabricaÃ§Ã£o e venda de dispositivos elÃ©tricos conduzidos, baterias, acessÃ³rios, garantias estendidas e outros produtos e serviÃ§os. Desenvolvimento, fabricaÃ§Ã£o e venda de soluÃ§Ãµes de hardware e software totalmente integradas e baseadas em nuvem que permitem que as autoridades policiais capturem, armazenem, gerenciem, compartilhem e analisem vÃ­deo e outras evidÃªncias digitais.', 'Scottsdale, AZ, United States', 4100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNGO', 'STOCK', 'Bionano Genomics, Inc.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Bionano Genomics, Inc. is a provider of genome analysis solutions that can enable researchers and clinicians to reveal answers to challenging questions in biology and medicine. The Company offers optical genome mapping (OGM) solutions for applications across basic, translational and clinical research. It also offers a platform-agnostic software solution, which integrates sequencing and microarray data designed to provide analysis, visualization, interpretation and reporting of copy number variants, single-nucleotide variants, and absence of heterozygosity across the genome in one consolidated view. The Company additionally offers nucleic acid extraction and purification solutions using proprietary isotachophoresis (ITP) technology. The Company markets and sells OGM systems, including the Saphyr system, which delivers OGM data to enable ultra-sensitive and ultra-specific detection of all classes of structural variation (SV).', 'San Diego, CA, United States', 98);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADEA', 'STOCK', 'Adeia Inc.', 'NMS', 'Technology', 'Software - Application', 'Adeia Inc. is a research and development and intellectual property licensing company. The Company operates as an incubator that invests in advanced research and development to create technologies for the entertainment, media, consumer electronics and semiconductor industries. It invents, develops, acquires, and licenses fundamental innovations that enhance a range of devices and shape the way various people explore and experience entertainment across a variety of platforms. Its solutions are focused on its consumers'' interaction with media, consumer electronics, and entertainment. Its IP licensing platform provides access to innovations that allow its customers, who are media, entertainment, consumer electronics, and semiconductor companies, to create technology solutions and products. It licenses its IP portfolio across markets, such as multichannel video programming distributors, over-the-top video service providers, social media companies, consumer electronics, and semiconductors.', 'San Jose, CA, United States', 150);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDC', 'STOCK', 'Belden Inc.', 'NYQ', 'Technology', 'Communication Equipment', 'Belden Inc. is a global supplier of complete connection solutions. Its Smart Infrastructure Solutions segment is a provider in network infrastructure and broadband solutions, as well as cabling and connectivity solutions for commercial audio/video and security applications. Its vertical markets include data centers, government, healthcare, and hospitality. Its Broadband Solutions primarily serve broadband and wireless service providers. Smart Infrastructure Solutions product lines include copper cable and connectivity solutions, fiber cable and connectivity solutions, interconnect panels, racks and enclosures, and secure, high performance signal extension and matrix switching systems. Its Automation Solutions segment at Belden provides network infrastructure and digitization solutions to enable its customers to make data-based business decisions. Its primary markets include discrete automation, process automation, energy, and mass transit.', 'Saint Louis, MO, United States', 7500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCS', 'STOCK', 'Invesco BulletShares 2028 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2028 (collectively, "2028 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COKE', 'STOCK', 'Coca-Cola Consolidated, Inc.', 'NMS', 'Consumer Defensive', 'Beverages - Non-Alcoholic', 'Coca-Cola Consolidated, Inc. distributes, markets and manufactures nonalcoholic beverages, primarily products of The Coca-Cola Company. The Company also distributes products to several other beverage companies, including Keurig Dr Pepper Inc. and Monster Energy Company. The Company offers a range of nonalcoholic beverage products and flavors, including both sparkling and still beverages. Sparkling beverages are carbonated beverages, and the Company''s principal sparkling beverage is Coca-Cola. Its still beverages include energy products and noncarbonated beverages such as bottled water, ready to drink tea, ready to drink coffee, enhanced water, juices and sports drinks. Its products are sold and distributed in the United States through various channels, which include selling directly to customers, including grocery stores, mass merchandise stores, club stores, convenience stores and drug stores, and selling to on-premise locations, where products are typically consumed immediately.', 'Charlotte, NC, United States', 15000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZTA', 'STOCK', 'Azenta, Inc.', 'NMS', 'Healthcare', 'Medical Instruments & Supplies', 'Azenta, Inc. Ã‰ um fornecedor de soluÃ§Ãµes de ciÃªncias da vida em todo o mundo. A empresa fornece um conjunto completo de soluÃ§Ãµes de gerenciamento de amostras de cadeia fria e serviÃ§os multiÃ´micos em Ã¡reas como desenvolvimento de medicamentos, pesquisa clÃ­nica e terapias celulares avanÃ§adas para instituiÃ§Ãµes farmacÃªuticas, biotecnolÃ³gicas, acadÃªmicas e de saÃºde em todo o mundo. Os segmentos da empresa incluem Sample Management Solutions e Multiomics. Seu segmento de SoluÃ§Ãµes de Gerenciamento de Amostra oferece produtos e serviÃ§os completos de gerenciamento de amostras, incluindo serviÃ§os de repositÃ³rio de amostras e produtos principais (lojas automatizadas, sistemas criogÃªnicos, tubo de amostra automatizado, consumÃ­veis e instrumentos e dispositivos de descongelamento de taxa controlada). O segmento Multiomics da Companhia inclui seu negÃ³cio de serviÃ§os genÃ´micos, que avanÃ§a as atividades de pesquisa e desenvolvimento fornecendo sequenciamento genÃ©tico, sÃ­ntese, ediÃ§Ã£o e serviÃ§os relaci', 'Burlington, MA, United States', 3000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSQ', 'STOCK', 'Calamos Strategic Total Return Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Strategic Total Return Fund is a closed ended balanced mutual fund launched by Calamos Investments LLC. The fund is managed by Calamos Advisors LLC. It invests in the public equity and fixed income markets of the United States. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in common and preferred stocks of companies across all market capitalizations, convertible securities, and high yield corporate bonds with an average credit rating of BB as rated by S&P. The fund employs both fundamental and quantitative analysis with a combination of bottom-up and top-down security picking approaches to create its portfolio. Calamos Strategic Total Return Fund was formed on December 31, 2003 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMCX', 'STOCK', 'AMC Networks Inc.', 'NMS', 'Communication Services', 'Entertainment', 'AMC Networks Inc. is a global entertainment company. The Company creates and curates series and films across distinct brands and makes them available to audiences everywhere. The CompanyÂ’s Domestic Operations segment consists of its five programming networks, its streaming services, its AMC Studios operation and its film distribution business. Its programming networks are AMC, We TV, BBC AMERICA, IFC, and SundanceTV. Its streaming services consist of AMC+ and its targeted subscription streaming services (Acorn TV, Shudder, Sundance Now, ALLBLK, and HIDIVE). Its AMC Studios operation produces original programming for its programming services and third parties and also licenses programming worldwide. Its film distribution business includes Independent Film Company, RLJ Entertainment Films and Shudder. The International segment consists of AMC Networks International (AMCNI), its international programming businesses consisting of a portfolio of channels distributed around the world.', 'New York, NY, United States', 1800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOND', 'STOCK', 'PIMCO Active Bond Exchange-Traded Fund', 'NYQ', NULL, NULL, 'The fund normally invests at least 80% of its assets in a diversified portfolio of Fixed Income Instruments of varying maturities, which may be represented by forwards or derivatives such as options, futures contracts, or swap agreement. It invests primarily in investment grade debt securities, but may invest up to 30% of its total assets in high yield securities, as rated by Moody''s, S&P or Fitch, or, if unrated, as determined by PIMCO.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AWP', 'STOCK', 'abrdn Global Premier Properties Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Abrdn Global Premier Properties Fund is a closed-end equity mutual fund launched and managed by Alpine Woods Capital Investors, LLC. It invests in the public equity markets across the globe. The fund invests in stocks of companies operating across real estate sectors. It invests in value stocks of companies. The fund employs fundamental analysis with top-down and bottom-up stock picking approach to create its portfolio. It benchmarks the performance of its portfolio against the FTSE EPRA/NAREIT Global TR Index, MSCI US REIT Gross Total Return Index, and S&P Developed BMI Property Index Net TR Index. Abrdn Global Premier Properties Fund was formed on February 13, 2007 and is domiciled in the United States.', 'Edinburgh, , United Kingdom', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HUSA', 'STOCK', 'Houston American Energy Corp.', 'ASE', 'Energy', 'Oil & Gas E&P', 'Houston American Energy Corp. is a renewable energy company focused on converting waste materials into valuable low-carbon fuels and chemicals. Through its proprietary pyrolysis technology, the Company addresses the global plastic waste crisis while supplying high-demand products like sustainable aviation fuel and recycled feedstocks to the energy and chemical industries. It develops, explores, exploits, acquires, and produces natural gas and crude oil properties. In the United States, the Company''s principal properties and operations are located in the onshore Permian Basin and Gulf Coast region of Louisiana. The Company holds an over 18.1% average working interest in 320 gross acres in Reeves County, Texas. It holds a 15.9% average working interest, subject to a proportionate 10% back-in after payout, in an over 360 gross acre block in Yoakum County, Texas. Its sole property in Louisiana consists of a 23.4% mineral interest in 2,485 gross acres in East Baton Rouge Parish.', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACCO', 'STOCK', 'ACCO Brands Corporation', 'NYQ', 'Industrials', 'Business Equipment & Supplies', 'ACCO Brands Corporation is a global consumer, technology and business branded products company, providing brands and product solutions used in schools, homes and at work. The Company operates through two segments: ACCO Brands Americas and ACCO Brands International. The Americas include the U.S., Canada, Brazil, Mexico and Chile and the International includes EMEA, Australia, New Zealand and Asia. Its primary products include note-taking products, computer and gaming accessories; planners; workspace machines, tools and essentials and dry-erase boards and accessories; filing and organization products; writing and art products and others. Its primary brands include Five Star, PowerA, Tilibra, AT-A-GLANCE, Kensington, Quartet, GBC, Mead, Swingline, Barrilito, Foroni, Hilroy, Leitz, Rapid, Kensington, Esselte, Rexel, PowerA, GBC, NOBO, Franken, Derwent, Marbig, Artline and Spirax. It distributes its products through a variety of channels and sells directly through e-commerce sites.', 'Lake Zurich, IL, United States', 5000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECAT', 'STOCK', 'BlackRock ESG Capital Allocation Term Trust', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELWS', 'STOCK', 'Earlyworks Co., Ltd', 'NCM', 'Technology', 'Software - Application', 'Earlyworks Co Ltd is a Japan-based company mainly engaged in the planning, proposal, design and development of blockchain system solution. The Company is also engaged in the planning, proposal, design and development through unit type semi-order development.', 'Tokyo, , Japan', 20);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSX', 'STOCK', 'Diana Shipping Inc.', 'NYQ', 'Industrials', 'Marine Shipping', 'Diana Shipping Inc. is a Greece-based global provider of shipping transportation services. The Company specializes in the ownership and bareboat charter-in of dry bulk vessels. The Company''s operating fleet consists of 40 dry bulk vessels, including 4 Newcastlemax, 11 Capesize, 5 Post-Panamax, 6 Kamsarmax, 8 Panamax, and 6 Ultramax. Its fleet combined carrying capacity is approximately 4.7 million deadweight tonnage (dwt) with a weighted average age of 10.16 years. The Company''s fleet is managed by its wholly-owned subsidiary Diana Shipping Services S.A. and its established 50/50 joint venture with Wilhelmsen Ship Management named Diana Wilhelmsen Management Limited.', 'Athens, , Greece', 981);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVA', 'STOCK', 'DaVita Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'DaVita Inc. Ã‰ um fornecedor de cuidados de saÃºde focado na transformaÃ§Ã£o da prestaÃ§Ã£o de cuidados para melhorar a qualidade de vida dos pacientes em todo o mundo. A Companhia Ã© uma provedora de serviÃ§os de assistÃªncia renal nos Estados Unidos. Seu negÃ³cio de diÃ¡lise dos Estados Unidos (diÃ¡lise dos EUA) e serviÃ§os de laboratÃ³rio relacionados trata pacientes com insuficiÃªncia renal crÃ´nica e doenÃ§a renal em estÃ¡gio final (ESKD). A robusta plataforma da empresa oferece serviÃ§os de assistÃªncia renal e inclui nefrologia e relaÃ§Ãµes de pagamento estabelecidas. As operaÃ§Ãµes internacionais da Companhia prestam serviÃ§os de diÃ¡lise e administrativos a um total de centros ambulatoriais de diÃ¡lise. O negÃ³cio de cuidados renais integrados (IKC) dos EUA da empresa fornece serviÃ§os integrados de cuidados e gestÃ£o de doenÃ§as a pacientes em arranjos de cuidados integrados baseados em risco e a pacientes adicionais em outros arranjos de cuidados integrados em todos os Estados Unidos. Ele tambÃ©m mantÃ©m al', 'Denver, CO, United States', 76000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCAT', 'STOCK', 'BlackRock Capital Allocation Term Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Capital Allocation Term Trust (the Trust) is a diversified, closed-end management investment company. The TrustÂ’s investment objectives are to provide total return and income through a combination of current income, current gains and long-term capital appreciation. The Trust invests in a portfolio of equity and debt securities. Generally, the TrustÂ’s portfolio will include both equity and debt securities. At any given time, however, the Trust may emphasize either debt securities or equity securities. The Trust utilizes an option writing (selling) strategy in an effort to generate current gains from options premiums and to enhance the TrustÂ’s risk-adjusted returns. The Trust can invest in all types of debt securities, including the United States and foreign government bonds, corporate bonds, convertible bonds, municipal bonds, structured notes, credit-linked notes, loan assignments and participations, and others. The TrustÂ’s investment adviser is BlackRock Advisors, LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAVA', 'STOCK', 'Endava plc', 'NYQ', 'Technology', 'Software - Infrastructure', 'Endava plc is a technology service provider. The Company provides a combination of product and technology strategies, intelligent experiences, and engineering to help customers become digital, experience-driven businesses by assisting them from idea generation to development and deployment of products, platforms, and solutions. It uses its Distributed Enterprise Agile scaling framework, known as TEAM Enterprise Agile Scaling (TEAS). TEAS helps in designing, developing, and testing digital solutions, providing actionable insights into their business potential. It also provides training for the customers that helps them to develop their technical and soft skills. It serves clients in the payments and financial services, technology, media, and telecom (TMT), consumer products, retail, mobility, and healthcare. The Company also provides outsourced development services across design, engineering and art/animation for PC and console video games and other digital entertainment.', 'London, , United Kingdom', 11365);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASND', 'STOCK', 'Ascendis Pharma A/S', 'NMS', 'Healthcare', 'Biotechnology', 'A Ascendis Pharma A/S Ã© uma empresa com sede na Dinamarca que fabrica produtos farmacÃªuticos. A empresa produz produtos para os tratamentos de deficiÃªncia de hormÃ´nio do crescimento, endocrinologia, distÃºrbios do sistema nervoso central, doenÃ§as infeciosas e diabetes. A empresa opera globalmente atravÃ©s de suas subsidiÃ¡rias: Ascendis Pharma GmbH (Alemanha), Ascendis Pharma, Inc. (Delaware, Estados Unidos), Ascendis Pharma Endocrinology, Inc. (Delaware, Estados Unidos), Ascendis Pharma, DivisÃ£o de Oftalmologia A/S (Dinamarca), Ascendis Pharma, DivisÃ£o de Endocrinologia A/S (Dinamarca), Ascentis Pharma DoenÃ§as Osso A/S (Dinamarca), Ascentis Pharma DistÃºrbios de Crescimento A/S (Dinamarca) e Ascendis Pharma Oncology Division A/S (Dinamarca).', 'Hellerup, , Denmark', 1017);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COOK', 'STOCK', 'Traeger, Inc.', 'NYQ', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'Traeger, Inc. designs, sources, sells, and supports wood pellet fueled barbecue grills and Flatrock flat top grills sold to retailers, distributors, and direct to consumers. The Company''s integrated platform includes six types of products: wood pellet grills, gas griddles, grilling accessories, digital content, the Traeger app, and consumables. The Company offers eight primary grill lines: Woodridge Series, Timberline Series, Ironwood Series, Pro Series with WiFIRE, Pro Series without WiFIRE, Portable Series, Club Lineup, and Flatrock flat top grill. It offers a variety of Traeger-branded wood pellets, rubs and sauces. It offers a variety of grill accessories, tools to aid in meal prep, cooking, and cleanup, replacement parts, and apparel and merchandise. It produces a library of digital content including instructional recipes and videos that demonstrate tips, tricks, and cooking techniques. The Traeger app is a mobile software application available on iOS or Android devices.', 'Salt Lake City, UT, United States', 665);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETV', 'STOCK', 'Eaton Vance Tax-Managed Buy-Write Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance Tax-Managed Buy-Write Opportunities Fund is a closed-ended equity mutual fund launched and managed by Eaton Vance Management. It is co-managed by Parametric Portfolio Associates LLC. The fund invests in the public equity markets of the United States. It seeks to invest in stocks of companies operating across diversified sectors. The fund also writes call options on one or more U.S. indices on a substantial portion of the value of its common stock portfolio. It benchmarks the performance of its portfolio against the S&P 500 Index, the CBOE S&P 500 BuyWrite Index, the NASDAQ-100 Index, and the CBOE NASDAQ-100 BuyWrite Index. Eaton Vance Tax-Managed Buy-Write Opportunities Fund was formed on June 30, 2005 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGEM', 'STOCK', 'Cullinan Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Cullinan Therapeutics, Inc. is a biopharmaceutical company. It has built a diversified portfolio of clinical-stage assets that inhibit key drivers of disease or harness the immune system to eliminate diseased cells in autoimmune diseases and cancer. Its portfolio includes a range of modalities. Its pipeline includes CLN-978, CLN-619, Zipalertinib (CLN-081/TAS6417), CLN-049, and CLN-617. CLN-978 is a CD19xCD3 T cell engager being developed for autoimmune diseases. CLN-619 is a monoclonal antibody that stabilizes expression of MICA/B on the tumor cell surface to promote tumor cell lysis mediated by cytotoxic innate and adaptive immune cells. Zipalertinib (CLN-081/TAS6417) is an orally available small-molecule, irreversible epidermal growth factor receptor inhibitor. CLN-049 is a FLT3xCD3 T cell engaging bispecific antibody. CLN-617 is a fusion protein combining two potent antitumor cytokines, interleukin-2 and interleukin-12 with tumor retention domains for the treatment of solid tumors.', 'Cambridge, MA, United States', 111);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGMH', 'STOCK', 'AGM Group Holdings Inc.', 'NCM', 'Technology', 'Computer Hardware', 'AGM Group Holdings Inc is a technology company engaged in global technology hardware supply chain and fintech blockchain ecosystem. The CompanyÂ’s products and services include: futures trading solution catering to clients using MetaTrader 5; retail-orientated online trading education website; foreign exchange (Forex) trading system that provides services to financial institutions outside of China; technology hardware research and development, manufacture, and sales. The Company operates its businesses in both the United Stated and global markets.', 'Wan Chai, , Hong Kong', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWST', 'STOCK', 'Casella Waste Systems, Inc.', 'NMS', 'Industrials', 'Waste Management', 'Casella Waste Systems, Inc. is a regional, vertically integrated solid waste services company. The Company provides resource management and services to residential, commercial, municipal, institutional, and industrial customers, primarily in the areas of solid waste collection and disposal, transfer, recycling, and organics services. It also holds collection operations across eastern Pennsylvania and western New Jersey. It manages its solid waste operations on a geographic basis through three regional operating segments: the Eastern, Western and Mid-Atlantic regions, each of which provides a comprehensive range of non-hazardous solid waste services. It manages its resource renewal operations through the Resource Solutions operating segment, which leverages its core competencies in materials processing, industrial recycling, organics and resource management service offerings to deliver comprehensive solutions for its commercial, municipal, institutional and industrial customers.', 'Rutland, VT, United States', 5100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NWS', 'STOCK', 'News Corporation', 'NMS', 'Communication Services', 'Entertainment', 'A News Corporation Ã© uma empresa diversificada de mÃ­dia e serviÃ§os de informaÃ§Ã£o. Seu segmento de ServiÃ§os imobiliÃ¡rios digitais consiste no interesse da Companhia pelo Grupo REA e pela Move. REA Group Ã© uma empresa de mÃ­dia digital especializada em imÃ³veis e serviÃ§os relacionados Ã  propriedade em seus sites e aplicativos mÃ³veis. A Move Ã© uma provedora de serviÃ§os imobiliÃ¡rios digitais nos Estados Unidos e opera principalmente uma plataforma de informaÃ§Ã£o imobiliÃ¡ria, publicidade e serviÃ§os, bem como seus serviÃ§os baseados em referÃªncia, ferramentas on-line e serviÃ§os para proprietÃ¡rios e inquilinos. Seu segmento Dow Jones consiste na Dow Jones, uma provedora global de notÃ­cias e informaÃ§Ãµes de negÃ³cios, que distribui seu conteÃºdo e dados por meio de uma variedade de canais de mÃ­dia. Seu segmento de publicaÃ§Ã£o de livros consiste em HarperCollins, uma editora de livros de consumo com operaÃ§Ãµes em 15 paÃ­ses. Seu segmento de mÃ­dia de notÃ­cias Ã© composto pela News Corp Australia, News UK e', 'New York, NY, United States', 22300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANDE', 'STOCK', 'The Andersons, Inc.', 'NMS', 'Consumer Defensive', 'Food Distribution', 'The Andersons, Inc., is a diversified company. The Company''s segments include Agribusiness and Renewables. The Agribusiness segment includes commodity merchandising, the operation of terminal grain elevator facilities, and the manufacturing and distribution plant nutrient products. The Company''s fertilizer categories include PureGrade, MicroSolutions, soil amendments, organic nutrients, and nitrogen, phosphorus and potash (NPK). Its farmer services include farm centers, originations & farmer risk management - United States, and originations & farmer risk management - Canada. Its merchandising include carbon; corn, beans, wheat, meal; ethanol; export; high-protein feed ingredient; propane and fuel products; fats, oils, and greases; wheat middlings, cottonseed, DDGS, and pet food ingredients. The Renewables segment produces, purchases and sells ethanol and co-products. The segment also operates a merchandising portfolio of ethanol, ethanol co-products and renewable diesel feedstocks.', 'Maumee, OH, United States', 2224);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABOS', 'STOCK', 'Acumen Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Acumen Pharmaceuticals, Inc. is a clinical-stage biopharmaceutical company. The Company is engaged in developing a disease-modifying approach to target underlying cause of Alzheimer''s disease (AD). The Company is focused on advancing a targeted immunotherapy drug candidate, sabirnetug (ACU193), in its Phase II ALTITUDE-AD clinical trial following Phase I results in early AD patients (patients with mild cognitive impairment or mild dementia due to AD). Sabirnetug is a recombinant humanized immunoglobulin gamma 2 (IgG2), monoclonal antibody (mAb) that selectively targets the anti-amyloid-beta oligomer, has demonstrated functional and protective effects in in-vitro assays, and has demonstrated in-vivo safety and pharmacologic activity in multiple animal species including transgenic mouse models for AD. The Company is developing sabirnetug for IV administration once every four weeks (Q4W) for the treatment of early AD, and it has developing sabirnetug for subcutaneous administration.', 'Newton, MA, United States', 61);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BDMD', 'STOCK', 'Baird Medical Investment Holdings Limited', 'NCM', 'Healthcare', 'Medical Devices', 'Baird Medical Investment Holdings Ltd is a company mainly engaged in the microwave ablation medical device business. The Company is mainly engaged in the provision of microwave ablation medical device. The medical devices are used for treatment of benign and malignant tumors, including thyroid nodules, liver cancer, lung cancer and breast lumps.', 'Guangzhou, , China', 143);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUSE', 'STOCK', 'First Busey Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'First Busey Corporation is a financial holding company. Its segments include Banking, Wealth Management and FirsTech. Banking segment provides a full range of banking services to individual and corporate customers through its wholly-owned bank subsidiary, Busey Bank. CrossFirst Bankshares, Inc. is also a wholly-owned bank subsidiary of the Company. Wealth Management segment provides a full range of asset management, investment, brokerage, fiduciary, philanthropic advisory, tax preparation, and farm management services to individuals, businesses, and foundations. Wealth management services to individuals include trust and estate advisory services and financial planning; businesses include business succession planning and employee retirement plan services, and foundations include investment strategy consulting and fiduciary services. FirsTech segment provides payment technology solutions and also provides additional tools to help clients with billing, reconciliation and others.', 'Champaign, IL, United States', 1950);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEPU', 'STOCK', 'Central Puerto S.A.', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Central Puerto SA is an Argentina-based company pertaining to the energy sector. The purpose of the Firm is to make investments in the national and international energy market. The Company and its subsidiaries are organized in four different business units, as follows: Electric power generation from conventional sources and its sale; Electric power generation from renewable sources and its sale; Natural gas transport and distribution; Management and operations of thermal plants. The Company operates various wind farms in Argentina such as La Castellana I, Achiras I, La Castellana II, among others.', 'Buenos Aires, , Argentina', NULL);\n